function sumOfNumbers() {
  let sum = 0;
let arr = [];
  for (let i = 0; i < arr.length; i++) {
    sum += arr[i];
  }
  return sum;
}
sumOfNumbers();

function celsiusToFahrenheit() {
  
  let fahrenheit = 0
  let arr = [];
  let result = 0
  for (let i = 0; i<arr.length; i++){
    fahrenheit = arr[i] * (9/5) + 32
    result = Math.floor(fahrenheit)
  } 
  return result;
}
celsiusToFahrenheit();


